import './Header.css';
import logo from '../../images/CC-UIE-black-logo.png';

function Navbar(){
  return (
    <div id="Header">
      <div class="bg-lightGray">
        <div class="topbar container-cc">
          <div>
            <img src={logo} class="img-resp" alt="CenterCentre Logo"
              style="padding-right: 20px" />
          </div>

          <div class="">
            <a class="btn btn-custom btn-shadow" href="#pricing">Enroll Now</a>
          </div>
        </div>
      </div>
    </div>


  );
}

export default Navbar;
